import React, { useState } from 'react';
import axios from 'axios';
import './ItemForm.css'; // Import the CSS file

const ItemForm = ({ onItemCreated }) => {
  const [formData, setFormData] = useState({
    actualPrice: '',
    comment: '',
    eventVenuesID: '',
    imageUrl: '',
    listingPrice: '',
    ordersID: '',
    sellerID: '',
    sellingPrice: '',
    status: '',
    type: '',
    validatedOn: '',
    verified: true,
    lock: true
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:5000/cart/tickets', formData)
      .then(response => {
        alert('Item created successfully');
        onItemCreated(); // Fetch updated item list
        console.log(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div className="form-container">
      <div className="form-wrapper">
        <h2>Create a new item</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group-inline">
            <label>Actual Price:</label>
            <input type="number" name="actualPrice" value={formData.actualPrice} onChange={handleChange} required />
          
            <label>Listing Price:</label>
            <input type="number" name="listingPrice" value={formData.listingPrice} onChange={handleChange} required />
          </div>
          <div className="form-group-inline">
            <label>Selling Price:</label>
            <input type="number" name="sellingPrice" value={formData.sellingPrice} onChange={handleChange} required />
          
            <label>EventVenuesID:</label>
            <input type="number" name="eventVenuesID" value={formData.eventVenuesID} onChange={handleChange} required />
          </div>

          <div className="form-group-inline">
            <label>Orders ID:</label>
            <input type="number" name="ordersID" value={formData.ordersID} onChange={handleChange} required />
          
            <label>Seller ID:</label>
            <input type="number" name="sellerID" value={formData.sellerID} onChange={handleChange} required />
          </div>

          <div className="form-group-inline">
            <label>Image URL:</label>
            <input type="text" name="imageUrl" value={formData.imageUrl} onChange={handleChange} required />
         
            <label>Status:</label>
            <input type="text" name="status" value={formData.status} onChange={handleChange} required />
          </div>
          <div className="form-group-inline">
            <label>Type:</label>
            <input type="text" name="type" value={formData.type} onChange={handleChange} required />
          </div>
          <div className="form-group-inline">
            <label>Validated On:</label>
            <input type="text" name="validatedOn" value={formData.validatedOn} onChange={handleChange} />
          </div>
          <div className="form-group-inline">
            <label>Comment:</label>
            <input type="text" name="comment" value={formData.comment} onChange={handleChange} />
          </div>
          <button type="submit">Create Item</button>
        </form>
      </div>
    </div>
  );
};

export default ItemForm;
